  <path fillRule="evenodd" clipRule="evenodd" d="M13 27.5C13 24.8748 13.0281 24 16.5 24C19.9719 24 20 24.8748 20 27.5C20 30.1252 20.0111 31 16.5 31C12.9889 31 13 30.1252 13 27.5Z" stroke="#1DC071" strokeWidth={2} strokeLinecap="round" strokeLinejoin="round" />
